import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  CircularProgress,
  Button
} from '@mui/material';
import { Line, Bar, Pie } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, PointElement, LineElement, BarElement, ArcElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, BarElement, ArcElement, Title, Tooltip, Legend);

function DateFilter({ onDateChange }) {
    const [selectedDate, setSelectedDate] = useState("");

    const handleDateChange = (event) => {
      const newDate = event.target.value;
      setSelectedDate(newDate);
      onDateChange(newDate);
    };

    return (
      <div>
        <label htmlFor="datePicker">Select Date: </label>
        <input
          type="date"
          id="datePicker"
          value={selectedDate}
          onChange={handleDateChange}
        />
      </div>
    );
  }


function DeviceAnalytics({ deviceId }) {
  const [loading, setLoading] = useState(true);
  const [chartData, setChartData] = useState({});
  const [chartType, setChartType] = useState('line'); // Options: 'line', 'bar', 'pie'
  const [selectedDate, setSelectedDate] = useState("");

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      try {
        const response = await fetch(`http://localhost:5001/api/devices/${deviceId}`);
        const device = await response.json();
        if (device && device.data) {
          filterData(device);
        } else {
          console.error("No data received for device:", deviceId);
          setChartData({});
        }
      } catch (error) {
        console.error("Error fetching device data:", error);
      }
      setLoading(false);
    };

    fetchData();
  }, [deviceId, selectedDate]);

  const filterData = (device) => {
    const filteredData = device.data.filter(d =>
      new Date(d.timestamp).toISOString().split('T')[0] === selectedDate
    );

    if (!filteredData.length) {
      console.error("No data available for selected date:", selectedDate);
      setChartData({});
      return;
    }

    const labels = filteredData.map(d => `${new Date(d.timestamp).getHours()}:00`);
    const waterFlowData = filteredData.map(d => d.waterFlow);
    const pressureData = filteredData.map(d => d.pressure);
    const temperatureData = filteredData.map(d => d.temperature);

    const data = {
      labels,
      datasets: [
        {
          label: 'Water Flow (L/s)',
          data: waterFlowData,
          borderColor: 'rgb(75, 192, 192)',
          backgroundColor: 'rgba(75, 192, 192, 0.5)',
        },
        {
          label: 'Pressure (psi)',
          data: pressureData,
          borderColor: 'rgb(255, 99, 132)',
          backgroundColor: 'rgba(255, 99, 132, 0.5)',
        },
        {
          label: 'Temperature (°C)',
          data: temperatureData,
          borderColor: 'rgb(53, 162, 235)',
          backgroundColor: 'rgba(53, 162, 235, 0.5)',
        }
      ]
    };
    setChartData(data);
  };

  if (loading) {
    return <CircularProgress />;
  }

  return (
    <Box>
      <Typography variant="h6" gutterBottom>
        Device Analytics: {deviceId}
      </Typography>
      <DateFilter onDateChange={setSelectedDate} />
      <Button variant="contained" onClick={() => setChartType('line')} sx={{ mr: 1 }}>Line Chart</Button>
      <Button variant="contained" onClick={() => setChartType('bar')} sx={{ mr: 1 }}>Bar Chart</Button>
      <Button variant="contained" onClick={() => setChartType('pie')}>Pie Chart</Button>
      {chartData.labels && chartData.labels.length > 0 ? (
        <>
          {chartType === 'line' && <Line data={chartData} />}
          {chartType === 'bar' && <Bar data={chartData} />}
          {chartType === 'pie' && <Pie data={chartData} />}
        </>
      ) : (
        <Typography>No data available for the selected date or device.</Typography>
      )}
    </Box>
  );
}

export default DeviceAnalytics;
